(9, 'Chuyên khoa Cơ xương khớp ', 'data:image/jpeg;base64,', '<h5><strong>Bệnh Cơ Xương Khớp</strong></h5>\n<ul>\n<li>Gout</li>\n<li>Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ</li>\n<li>Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân</li>\n<li>Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai</li>\n<li>Loãng xương, đau nhức xương</li>\n<li>Viêm xương, gai xương</li>\n<li>Viêm cơ, Teo cơ, chứng đau mỏi cơ</li>\n<li>Yếu cơ, Loạn dưỡng cơ</li>\n<li>Các chấn thương về cơ, xương, khớp</li>\n<li>...</li>\n</ul>\n', '\n##### **Bệnh Cơ Xương Khớp**\n\n* Gout\n* Thoái hóa khớp: khớp gối, cột sống thắt lưng, cột sống cổ\n* Viêm khớp dạng thấp, Viêm đa khớp, Viêm gân\n* Tràn dịch khớp gối, Tràn dịch khớp háng, Tràn dịch khớp khủy, Tràn dịch khớp vai\n* Loãng xương, đau nhức xương\n* Viêm xương, gai xương\n* Viêm cơ, Teo cơ, chứng đau mỏi cơ\n* Yếu cơ, Loạn dưỡng cơ\n* Các chấn thương về cơ, xương, khớp\n* ...', '2023-07-11 14:57:37', '2023-07-11 14:57:37');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(10, 'Chuyên khoa Tiêu hoá', 'data:image/jpeg;base64,', '<h5><strong>Tư vấn, khám và điều trị các Bệnh Tiêu hóa</strong></h5>\n<ul>\n<li>Ăn uống kém, không ngon</li>\n<li>Rối loạn tiêu hóa, táo bón, trĩ</li>\n<li>Nhiễm vi khuẩn HP (Helicobacter pylori)</li>\n<li>Nội soi dạ dày, đại tràng, tiêu hóa</li>\n<li>Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi</li>\n<li>Co thắt thực quản, Hội chứng ruột kích thích</li>\n<li>Đau bụng, dạ dày, đại tràng, thượng vị</li>\n<li>Viêm đại tràng, dạ dày, tá tràng</li>\n<li>Ung thư dạ dày, U nang tuyến tụy</li>\n<li>Bệnh lý về gan, mật</li>\n<li>...</li>\n</ul>\n', '##### **Tư vấn, khám và điều trị các Bệnh Tiêu hóa**\n* Ăn uống kém, không ngon\n* Rối loạn tiêu hóa, táo bón, trĩ\n* Nhiễm vi khuẩn HP (Helicobacter pylori)\n* Nội soi dạ dày, đại tràng, tiêu hóa\n* Buồn nôn, chướng bụng, đầy bụng ợ chua, đầy hơi\n* Co thắt thực quản, Hội chứng ruột kích thích\n* Đau bụng, dạ dày, đại tràng, thượng vị\n* Viêm đại tràng, dạ dày, tá tràng\n* Ung thư dạ dày, U nang tuyến tụy\n* Bệnh lý về gan, mật\n* ...', '2023-07-11 14:59:33', '2023-07-11 14:59:33');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(11, 'Chuyên khoa Tim mạch', 'data:image/jpeg;base64,', '<h4><strong>Khám tư vấn tim mạch</strong></h4>\n<ul>\n<li>Khó thở, Đau ngực, đau tim</li>\n<li>Tăng huyết áp, hạ huyết áp</li>\n<li>Rối loạn mỡ máu, cao huyết áp, chóng mặt</li>\n<li>Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ</li>\n<li>Cảm giác hồi hộp, tim đập nhanh</li>\n<li>Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến</li>\n<li>Đã đặt stent tim, nong động mạch vành</li>\n<li>Giãn tĩnh mạch chân</li>\n<li>...</li>\n</ul>\n', '#### **Khám tư vấn tim mạch**\n* Khó thở, Đau ngực, đau tim\n* Tăng huyết áp, hạ huyết áp\n* Rối loạn mỡ máu, cao huyết áp, chóng mặt\n* Bệnh van tim (Hẹp hở van tim), Hẹp động mạch chủ\n* Cảm giác hồi hộp, tim đập nhanh   \n* Tim bẩm sinh, có tiền sử bệnh tim to, tiền sử tai biến   \n* Đã đặt stent tim, nong động mạch vành\n* Giãn tĩnh mạch chân   \n* ...', '2023-07-11 15:00:05', '2023-07-11 15:00:05');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(12, 'Chuyên khoa Tai mũi họng', 'data:image/jpeg;base64,', '<h5><strong>Các bệnh Tai Mũi Họng</strong></h5>\n<ul>\n<li>Ù tai, đau tai, chảy máu tai</li>\n<li>Thủng màng nhĩ, điếc đột ngột</li>\n<li>Viêm tai giữa</li>\n<li>Amidan, V.A</li>\n<li>Viêm xoang</li>\n<li>Nghẹt mũi</li>\n<li>Hay bị chảy máu cam</li>\n<li>Đau cổ họng, khó nuốt</li>\n<li>Ho kéo dài</li>\n<li>Ngủ ngáy</li>\n<li>...</li>\n</ul>\n', '\n##### **Các bệnh Tai Mũi Họng**\n\n\n* Ù tai, đau tai, chảy máu tai\n* Thủng màng nhĩ, điếc đột ngột\n* Viêm tai giữa\n* Amidan, V.A\n* Viêm xoang\n* Nghẹt mũi\n* Hay bị chảy máu cam\n* Đau cổ họng, khó nuốt\n* Ho kéo dài\n* Ngủ ngáy\n* ...', '2023-07-11 15:01:25', '2023-07-11 15:01:25');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(13, 'Chuyên khoa Y học cổ truyền', 'data:image/jpeg;base64,', '<h5><strong>Tư vấn, khám và điều trị các vấn đề:</strong></h5>\n<ul>\n<li>Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...</li>\n<li>Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...</li>\n<li>Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...</li>\n<li>Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...</li>\n</ul>\n', '\n##### **Tư vấn, khám và điều trị các vấn đề:**\n* Bệnh lý thần kinh: đau đầu, mất ngủ, suy nhược thần kinh...\n* Bệnh lý cơ xương khớp: đau mỏi tay chân, thoái hóa khớp, viêm khớp...\n* Bệnh lý tim mạch: Tăng huyết áp, huyết áp thấp, đau thắt ngực...\n* Bệnh lý đường tiêu hóa: đau bụng, rối loạn chức năng tiêu hóa...', '2023-07-11 15:01:55', '2023-07-11 15:01:55');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(14, 'Chuyên khoa Nhi', 'data:image/jpeg;base64,', '<h5><strong>Khám và điều trị</strong></h5>\n<ul>\n<li>Bệnh lý sơ sinh</li>\n<li>Bệnh tiêu hóa</li>\n<li>Bệnh tuần hoàn</li>\n<li>Bệnh hô hấp</li>\n<li>Bệnh huyết học</li>\n<li>Bệnh thận Tiết niệu</li>\n<li>Bệnh thần kinh</li>\n<li>Bệnh ngoài da</li>\n<li>Bệnh xương khớp</li>\n</ul>\n', '##### **Khám và điều trị**\n* Bệnh lý sơ sinh\n* Bệnh tiêu hóa\n* Bệnh tuần hoàn\n* Bệnh hô hấp\n* Bệnh huyết học\n* Bệnh thận Tiết niệu\n* Bệnh thần kinh\n* Bệnh ngoài da\n* Bệnh xương khớp', '2023-07-11 15:02:35', '2023-07-11 15:02:35');
INSERT INTO "Specialties" ("id", "name", "image", "descriptionHTML", "descriptionMarkdown", "createdAt", "updatedAt") VALUES
(15, 'Chuyên khoa Nam học', 'data:image/jpeg;base64,', '<h5><strong>Tư vấn, khám và điều trị các Bệnh chuyên khoa Nam học</strong></h5>\n<ul>\n<li>Mãn dục nam giới, Suy sinh dục nam</li>\n<li>Viêm đường tiết niệu – sinh dục</li>\n<li>Viêm nhiễm: viêm bao quy đầu, viêm tinh hoàn</li>\n<li>Bệnh lý bao quy đầu: hẹp, dài bao quy đầu</li>\n<li>Rối loạn chức năng sinh dục: xuất tinh sớm, rối loạn cương dương, rối loạn xuất tinh, Xuất tinh kèm máu…</li>\n<li>Bệnh xã hội: lậu, giang mai, sùi mào gà, herpes…</li>\n<li>Các trường hợp sẩn ngứa, sẩn cục cơ quan sinh dục</li>\n<li>Xuất tinh ngược, Viêm tinh hoàn</li>\n<li>Các bệnh lý liên quan đến hiếm muộn</li>\n<li>Tinh hoàn ẩn</li>\n<li>...</li>\n</ul>\n', '##### **Tư vấn, khám và điều trị các Bệnh chuyên khoa Nam học**\n* Mãn dục nam giới, Suy sinh dục nam\n* Viêm đường tiết niệu – sinh dục\n* Viêm nhiễm: viêm bao quy đầu, viêm tinh hoàn\n* Bệnh lý bao quy đầu: hẹp, dài bao quy đầu\n* Rối loạn chức năng sinh dục: xuất tinh sớm, rối loạn cương dương, rối loạn xuất tinh, Xuất tinh kèm máu…\n* Bệnh xã hội: lậu, giang mai, sùi mào gà, herpes…\n* Các trường hợp sẩn ngứa, sẩn cục cơ quan sinh dục\n* Xuất tinh ngược, Viêm tinh hoàn\n* Các bệnh lý liên quan đến hiếm muộn\n* Tinh hoàn ẩn\n* ...', '2023-07-11 15:03:07', '2023-07-11 15:03:07');
